import Page2 from './Pages/Page2';

function App() {
  return (
    <>
    <Router>
        {/* <Switch> */}
          <Route exact path="/" component={Dashboard} />
          <Route path="/page2" component={Page2} />
          {/* <Route path="/contact" component={Contact} />
          <Route component={NotFound} /> */}
        {/* </Switch> */}
    </Router>
      {/* <Dashboard /> */}
    </>
  );
}

export default App;
